import java.util.Scanner;

class Node {
    int key;
    Node prev;
    Node next;

    public Node(int key) {
        this.key = key;
        this.prev = null;
        this.next = null;
    }
}

public class DoublyLinkedList {
    Node head;
    Node tail;

    public void insert(int key) {
        Node newNode = new Node(key);
        if (head == null) {
            head = newNode;
            tail = newNode;
        } else {
            newNode.next = head;
            head.prev = newNode;
            head = newNode;
        }
    }

    public void delete(int key) {
        Node temp = head;
        while (temp != null) {
            if (temp.key == key) {
                if (temp.prev != null) {
                    temp.prev.next = temp.next;
                } else {
                    head = temp.next;
                }
                if (temp.next != null) {
                    temp.next.prev = temp.prev;
                } else {
                    tail = temp.prev;
                }
                return;
            }
            temp = temp.next;
        }
    }

    public void deleteFirst() {
        if (head != null) {
            head = head.next;
            if (head != null) {
                head.prev = null;
            } else {
                tail = null;
            }
        }
    }

    public void deleteLast() {
        if (tail != null) {
            tail = tail.prev;
            if (tail != null) {
                tail.next = null;
            } else {
                head = null;
            }
        }
    }

    public void printList() {
        Node temp = head;
        while (temp != null) {
            System.out.print(temp.key + " ");
            temp = temp.next;
        }
        System.out.println();
    }

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        DoublyLinkedList dll = new DoublyLinkedList();
        for (int i = 0; i < n; i++) {
            String command = scanner.next();
            int key = scanner.nextInt();
            if (command.equals("insert")) {
                dll.insert(key);
            } else if (command.equals("delete")) {
                dll.delete(key);
            } else if (command.equals("deleteFirst")) {
                dll.deleteFirst();
            } else if (command.equals("deleteLast")) {
                dll.deleteLast();
            }
        }
        dll.printList();
    }
}
